body {
    color: #b1b1b1 !important;
    background-color: #23232D !important;
}
#body.light {
    color: #b1b1b1 !important;
    background-color: #23232D !important;
}
#body.light .header .header-menu .left .ant-menu .ant-menu-item a {
    color: #b1b1b1!important;
}
#body.light .header .header-menu .right .support .profile {
    color: #b1b1b1;
}
#body.light .content .content-header .content-menu .ant-menu-item a, #body.light .content .content-section .content-header .content-title {
    color: #b1b1b1;
}
.content .content-header .content-title {
    color: dimgrey;
}

.content.overview .res-list .row .res-item {
    background-color: #2C2C36;
    border: 2px solid #2C2C36!important;
}
.content.overview .res-list .row .res-item {
    color: #b1b1b1;
}
#body.light .ant-table {
    background-color: #2C2C36;
    border: 2px solid #2C2C36!important;
}
.ant-table-placeholder {
    background-color: #2C2C36;
    border: 2px solid #2C2C36!important;
}
#body.light .ant-table {
    color: #b1b1b1!important;
}
.ant-input {
    border: 2px solid #3A3A49;
    background: #3A3A49;
    color: #b1b1b1!important;    
}
.header .header-menu .left .logo {
    background: #e8e8e8;
    border-radius: 5px;
    padding: 2px;
}
}
